func TestPgsql_GetAllDdfHex(t *testing.T) {

	path := "D:\\project\\GolangProject\\davinci\\lib\\postgresql\\linux\\arm64\\"
	dir, _ := ioutil.ReadDir(path)

	fmt.Println("123")
	for _, fi := range dir {
		fullName := path + fi.Name()
		sep := strings.Split(fullName, "_")
		tmp := sep[len(sep)-1]
		version := strings.ReplaceAll(tmp[:len(tmp)-3], ".", "_")
		//fmt.Println(version)
		content, _ := ioutil.ReadFile(fullName)
		h := hex.EncodeToString(content)
		fmt.Println(fmt.Sprintf("var LINUX_X86_UDF_HEX_%s = \"%s\"", version, h))
	}
	fmt.Println("456")
}

